    /* find the length of last word in string*/
    public static int lengthOfLastWord(String s) {
        if(s!= null && s.length() > 1){
            String[] list =s.split("\\s");
            String word=list[list.length - 1];
            return word.length();
        }else
            return 0;
    }

    /* print Fuzz if the num is accepts to be devised on 3,print Buzz if the num is accepts to be devised on 5
    * print FuzzBuzz if the num is accepts to be devised on 3 && 5 */
    public static List<String> fizzBuzz(int n) {
        List<String> list = new ArrayList<String>();
        if (n == 0)
            return null;
        else{
            for(int i=1 ; i <= n ; i++){
                if((i % 3 == 0) && (i % 5 == 0))
                    list.add("FizzBuzz");
                else if(i % 3 == 0)
                    list.add("Fizz");
                else if(i % 5 == 0)
                    list.add("Buzz");
                else
                    list.add(""+i+"");
            }
        }
        return list;
    }

    /* find how many ones repeated without any other number in between in array */
    public static int findMaxConsecutiveOnes(int[] nums) {
        int count = 0;
        int max = 0;
        for (int num : nums) {
            if (num == 1)
                count++;
            else {
                if (count > max)
                    max = count;
                count = 0;
            }
        }
        if(count > max )
            max = count;
        return max;
    }

    /* find the number of numbers with even number of digits in array */
    public static int findNumbers(int[] nums) {
        int count = 0;
        for (int value : nums) {
            int countDigit = 1;
            int numberOfDigit = countDigit(value, countDigit);
            if (numberOfDigit % 2 == 0)
                count++;
        }
        return count;
    }

    /* count the number of digits */
    private static int  countDigit(double value , int count) {
        double result = value / 10;
        if(result >= 1){
            count ++;
            return countDigit(result , count);
        }
        return count;
    }

/* remove duplicate values from array */
    public static int removeDuplicates_3(int[] nums) {
        if (nums.length == 0) return 0;
        int i = 0;
        for (int j = 1; j < nums.length; j++) {
            if (nums[j] != nums[i]) {
                i++;
                nums[i] = nums[j];
            }
        }
//        for(int el :nums){
//            System.out.println(el);
//        }
        return i + 1;
    }

    /* to find if the array is palindromes */
    private static boolean isPalindromes(int[] input) {
        int length = input.length;
        int [] traverseInput = getTraverse(input);
        for (int i = 0; i <length ; i++) {
            if(input[i] != traverseInput[i])
                return false;
        }
        return true;
    }

    private static int[] getTraverse(int[] input) {
        int length = input.length;
        int[] traverseInput = new int[length];
        for (int i = length-1; i >=0 ; i--) {
            traverseInput[length-i-1] = input[i];
        }
        return traverseInput;
    }

    //another solution
    public static boolean isPalindrome(int arr[]) {
        int n= arr.length;
        // Loop till array size n/2.
        for (int i = 0; i <= n / 2 && n != 0; i++) {

            // Check if first and last element are different
            if (arr[i] != arr[n - i - 1]) {
                return false;
            }
        }
        return true;
    }



